descr:
RUE BOILEAU
Au 2ème étage avec deux ascenseurs d'un immeuble récent, ce bel appartement de trois pièces, récemment rénové, comprend:
- une grande entrée (marbre);
- une grande salle de séjour sur rue de 30m² avec un balcon (Est);
- Toilettes et lave-mains invités;
- deux chambres sur jardin (grands balcons, Ouest);
- une cuisine équipée (four, hotte, plaques de cuisson, vide-ordure, réfrigérateur-congélateur, lave-linge, lave-vaisselle);
- une salle de bains;
- une salle d'eau;
Digicode, gardienne, interphone, cave au 1er sous-sol, parking au 2ème sous-sol.
Chauffage et eau chaude collectifs. Parquet massif. Nombreux placards. Volets roulants manuels et stores-bannes.
Proche du Marché d'Auteuil et du Lycée Jean-Baptiste Say. Métros et bus.
Visites au jour et à l'heure de votre choix.

Vue Tour Eiffel depuis cet appartement de 110 m² de style loft; au 5ème étage avec ascenseur, entrée grand séjour de 50 m² avec cuisine US bien intégrée, grande baie vitrée et bonne hauteur de plafond; mobilier moderne; 3 chambres; salle de bains et salle de douche; WC séparé; buanderie; placards; chauffage collectif; gardien; secteur très commerçant et école bilingue à proximité;
Libre de suite;
TEL;.

LOCATION SAISSONNIERE RUE L'Université dans un bel immeuble ancien un appartement de bons standings 100 m² meublés au 4ème étage avec ascenseur comprenant un séjour double de 30 m², salle à manger, cuisine dinatoire, 2 chambres, salle de bain et salle d'eau, WC séparé;
L'appartement est équipé d'internet, lave-linge, lave-vaisselle, réfrigérateur.
Lumineux et ensoleillé proche métro et RER.

PRODUIT D'EXCEPTION ! APPARTEMENT SOMPTUEUX !
Directement sur la place du Général CATROUX, à deux pas du PARC MONCEAU, au 4ème et dernier étage d'un magnifique immeuble en pierre de taille de type haussmannien, un superbe appartement à la fois de réceptions et familial entièrement restauré dans des matériaux de grande qualité, alliant ancien et contemporain dans un raffinement extrême. De surcroît cet appartement réuni un ensemble de qualité indéniable aucun vis à vis, calme absolu, vue dégagée, triple exposition, parquet, moulures, cheminées;
EXCLUSIVITÉ ALMA IMMOBILIER.
